import '../Nav/Nav.css';
import React from 'react';
import { NavLink, Route, Switch } from 'react-router-dom';

const Home = () => <div>Home</div>;
const Login = () => <div>Login</div>;
const Mypage = () => <div>Mypage</div>;
const Order = () => <div>Order</div>;
const Cart = () => <div>Cart</div>;
const Qna = () => <div>Qna</div>;
const Store = () => <div>Store</div>;

const Nav = () => {
    return (
        <nav>
            <div className="Nav">
                <ul><li><NavLink to='/'>Home</NavLink></li></ul>
                <ul><li><NavLink to='/Login'>Login</NavLink></li></ul>
                <ul><li><NavLink to='/Mypage'>Mypage</NavLink></li></ul>
                <ul><li><NavLink to='/Order'>Order</NavLink></li></ul>
                <ul><li><NavLink to='/Cart'>Cart</NavLink></li></ul>
                <ul><li><NavLink to='/Qna'>Qna</NavLink></li></ul>
                <ul><li><NavLink to='/Store'>Store</NavLink></li></ul>
            </div>
            {/* <Switch>
                <Route path='/Login' component={Login} />
                <Route path='/Mypage' component={Mypage} />
                <Route path='/Order' component={Order} />
                <Route path='/Cart' component={Cart} />
                <Route path='/Qna' component={Qna} />
                <Route path='/Store' component={Store} />
                <Route path='/' component={Home} />
            </Switch> */}
        </nav>
    );
}

export default Nav;
